// Imports from MUI lib
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Button from '@mui/material/Button';
import React from 'react'
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import './Navbar.css'
// Create navbar
const pages = ['About', 'Projects', 'Contact'];

function Navbar() {
    const [value, setValue] = React.useState('one');

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };
    return (
        /*<AppBar position='sticky'>
            <Container maxWidth='xl'>
                <Toolbar disableGutters>
                    <div><img src='logo.png' width='50' height='50' alt='logo'/></div>
                    <Typography
                        variant='h6'
                        noWrap
                        component='a'
                        href='/'
                        sx={{
                            mr: 1.5,
                            display: { xs: 'none', md: 'flex' },
                            fontFamily: 'monospace',
                            fontWeight: 700,
                            letterSpacing: '.2rem',
                            color: 'inherit',
                            textDecoration: 'none',
                        }}
                    >
                        &nbsp;Kfir Tayar {/!* Code for one space: &nbsp; *!/}
                    </Typography>
                    <Box sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' } }}>
                        <Button
                            key={pages[0]}
                            href={'/'}
                            sx={{ my: 2, color: 'white', display: 'block' }}
                        >
                            {pages[0]}
                        </Button>
                        <Button
                        key={pages[1]}
                        href={'/projects'}
                        sx={{ my: 2, color: 'white', display: 'block' }}
                        >
                             {pages[1]}
                        </Button>
                            <Button
                            key={pages[2]}
                            href={'/contact'}
                            sx={{ my: 2, color: 'white', display: 'block' }}
                            >
                        {pages[2]}
                            </Button>
                    </Box>
                </Toolbar>
            </Container>
        </AppBar>*/

        <TabContext value={value}>
            <Box sx={{ width: '100%' }}>
                <TabList
                    onChange={handleChange}
                    aria-label="wrapped label tabs example"
                    TabIndicatorProps={{ children: <TabIndicator color="secondary" /> }}
                >
                    <Tab value="one" label="About" />
                    <Tab value="two" label="Projects" />
                    <Tab value="three" label="Contact" />
                </TabList>
            </Box>

            <TabPanel value="one">
                {/* Content for the 'About' tab */}
                <div>About Page Content</div>
            </TabPanel>
            <TabPanel value="two">
                {/* Content for the 'Projects' tab */}
                <div>Projects Page Content</div>
            </TabPanel>
            <TabPanel value="three">
                {/* Content for the 'Contact' tab */}
                <div>Contact Page Content</div>
            </TabPanel>
        </TabContext>
    );
}
export default Navbar;
